import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  return (
    <div className="navbar">
      <div className="navbar-left">
        <span className="navbar-title">OSGB YÖNETİM PANELİ</span>
      </div>
      <div className="navbar-right">
        {location.pathname !== '/dashboard' && (
          <button className="nav-button" onClick={() => navigate('/dashboard')}>Ana Sayfa</button>
        )}
        <button className="nav-button" onClick={() => navigate('/experts')}>Uzman</button>
        <button className="nav-button" onClick={() => navigate('/doctors')}>Hekim</button>
        <button className="nav-button" onClick={() => navigate('/dsps')}>DSP</button>
        <button className="nav-button" onClick={() => navigate('/workplaces')}>İş Yeri</button>
        <button className="nav-button" onClick={() => navigate('/accounting')}>Muhasebe</button>
        <button className="nav-button" onClick={() => navigate('/data')}>Veri Aktar</button>
        <button className="nav-button" onClick={handleLogout}>Çıkış</button>
      </div>
    </div>
  );
};

export default Navbar;
